import React from 'react';
import Modal from '@mui/material/Modal';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

interface ModalProps {
  open: boolean;
  onClose: () => void;
}

const ModalContent = () => (
  <Box sx={{background:'white'}}>
    <Typography id="modal-addtask-title" variant="h6" component="h2">
      Text in a modal
    </Typography>
    <Typography id="modal-addtask-description" sx={{ mt: 2 }}>
      Duis mollis, est non commodo luctus, nisi erat porttitor ligula.
    </Typography>
  </Box>
);

const ModalAddTask: React.FC<ModalProps> = ({ open, onClose }) => {
    return (
      <Modal
        open={open}
        onClose={onClose}
        aria-labelledby="modal-addtask-title"
        aria-describedby="modal-addtask-description"
      >
        <ModalContent />
      </Modal>
    );
  };

export default ModalAddTask;
